import React from 'react'

function CommentsList(props) {
    console.log(props);
    return (
        <div>
            <ul id="commentlist" className= "commentlist"> 
                {props.comments.map ((comment) => (
                    // console.log(comment);
                        <div>
                            <li key={comment.id}>
                            {comment.name} 
                            </li>
                            <li>
                            {new Date(comment.timestamp).toLocaleDateString()} 
                            </li>
                            <li>
                            {comment.comment}
                            </li>
                        </div>
                ))}                         
            </ul> 
        </div>
    )
}

export default CommentsList
